pragma solidity ^0.8.0;

import "../client/node_modules/@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./Mintable.sol";
import "./crowdsale.sol";
import "./MintedCrowdsale.sol";
import "./kycContract.sol";

contract MyMintedToken is ERC20Mintable {
    constructor() {

    }
}

contract MyMintedCrowdsale is Crowdsale, MintedCrowdsale {

    kycContract kyc;
    constructor(
        uint256 rate,    // rate in TKNbits
        address payable wallet,
        IERC20 token,
        kycContract _kyc
    )
        MintedCrowdsale(rate, wallet, token)
        public
    {
        kyc = _kyc;
    }

    function _deliverTokens(address beneficiary, uint256 tokenAmount) internal override(Crowdsale, MintedCrowdsale) virtual {
        super._deliverTokens(beneficiary, tokenAmount);
    }

    function _preValidatePurchase(address beneficiary, uint256 weiAmount) internal view override {
        super._preValidatePurchase(beneficiary, weiAmount);
        require(kyc.kycCompleted(msg.sender), "KYC not completed, you are not allowed");
    }
}

contract MyCrowdsaleDeployer {
    constructor(kycContract _kyc)
        public
    {
        // create a mintable token
        ERC20Mintable token = new MyMintedToken();

        // create the crowdsale and tell it about the token
        Crowdsale crowdsale = new MyMintedCrowdsale(
            1,
            payable(msg.sender),
            token,
            _kyc
        );

        // transfer the minter role from this contract (the default)
        // to the crowdsale, so it can mint tokens
        token.addMinter(address(crowdsale));
        token.renounceMinter();
    }
}
